import Vuex from 'vuex'
import Vue from "vue";

Vue.use(Vuex)

export default new Vuex.Store({
    state: {
        fromToken: null,
        toToken: null,
        list: [
            {id: 0, name: 'BTC', rate: 60776.16, logo: 'data:image/png;base64,'},
            {id: 1, name: 'ETH', rate: 2185.79, logo: 'data:image/png;base64,'},
            {id: 2, name: 'BNB', rate: 600.33, logo: 'data:image/png;base64,'},
            {id: 3, name: 'XRP', rate: 1.39, logo: 'data:image/png;base64,'},
            {id: 4, name: 'USDT', rate: 1.1, logo: 'data:image/png;base64,'},
            {id: 5, name: 'ADA', rate: 1.31, logo: 'data:image/png;base64,'},
            {id: 6, name: 'DOT', rate: 41.12, logo: 'data:image/png;base64,'},
            {id: 7, name: 'LTC', rate: 256.09, logo: 'data:image/png;base64,'},
            {id: 8, name: 'UNI', rate: 31.6, logo: 'data:image/png;base64,'},
            {id: 9, name: 'TRX', rate: 0.1309, logo: 'data:image/png;base64,'},
            {id: 10, name: 'ATOM', rate: 23.28, logo: 'data:image/png;base64,'},
        ],
    },
    getters: {
        getToRate(state) {
            return state.toToken.rate
        },
        getFromRate(state) {
            return state.fromToken.rate
        },
        getSearchList(state)  {
            return search => {
                return  state.list.filter(item => (item.name || '').toLowerCase().includes(search.toLowerCase()))
            }
        },
        checkComplete(state) {
            return state.fromToken !== null && state.toToken !== null
        }
    },
    mutations: {
        setFrom(state, val){
            state.fromToken = state.list.find(item => item.id === val)
        },
        setTo(state, val){
            state.toToken = state.list.find(item => item.id === val)
        }
    },
    actions: {
        setFrom({ commit }, val){
            commit('setFrom', val)
        },
        setTo({ commit }, val){
            commit('setTo', val)
        }
    }


})

